var jsonfile = require('jsonfile')

exports.writeFile = function(data)
{
    jsonfile.writeFile("/frontEnd/src/Components/json.json", data ,(err) =>
    {
        if(err)
        {
            console.log(err)
        }
        else
        {
            console.log("console..")
        }    
    })
}
